    def find_bracket(self, board, player, square, direction):
        """
        Find a square that forms a match with `square` for `player` in the given
        `direction`.  Returns None if no such square exists.

        Assumes that 'square' is a blank. Direction is one of the eight valid
        directions. Return the index of a square in 'player''s color
        so that there is a string of opponent pieces in between.
        """
        curr = square + direction
        while board[curr] == OPPONENT[player]:
            curr = curr + direction
        if board[curr] == player:
            return True
        return False

    def is_move_valid(self, board, player, move):
        """Is this a legal move for the player?"""
        valid_dir = []
        for direct in DIRECTIONS:
            if self.find_bracket(board,player,move,direct):
                valid_dir.append(direct)
        return valid_dir

    def get_valid_moves(self, board, player):
        """Get a list of all legal moves for player."""
        if (board,player) in cache:
            return cache[board,player]
        valid = {}
        for i in range(100):
            if board[i] == EMPTY:
                for d in DIRECTIONS:
                    curr = i + d
                    while board[curr] == OPPONENT[player]:
                        if board[curr + d] == player:
                            if i not in valid:
                                valid[i] = [d]
                            else:
                                valid[i] = valid[i] + [d]
                        curr += d
        moves = valid.keys()
        cache[(board,player)] = moves
        return moves

    def has_any_valid_moves(self, board, player):
        """Can player make any moves?"""
        if len(self.get_valid_moves(board,player)) == 0:
            return False
