        if (board,player,move) in move_cache:
            return move_cache[(board,player,move)]
        moves = self.is_move_valid(board, player, move)
        boardlist = list(board)
        boardlist[move] = player
        for d in moves:
            curr = move + d
            while board[curr] == OPPONENT[player]:
                boardlist[curr] = player
                curr += d

        # returns a new board/string
        new_board =  "".join(boardlist)
        move_cache[(board,player,move)] = new_board
        return new_board

