    def edge_table(self):
        queue = deque()
        queue.append(("..........",0))
        values = {}
        while queue:
            edge,depth = queue.popleft()
            if depth > 10:
                continue
            values[edge] = self.score_edge(edge)
            #make method to create edge children
            if depth < 10:
                edgeL = list(edge)
                edgeL[depth] = BLACK
