    def edge_move_probability(self, player, edge, pos):
        edgeStaticProbability = ((.10, .40, .70), # maps number of opposing neighbors to our neighbors,
                                 (.05, .30, None),# if the move has 0 neighbors of same color and 2 of opposing color
                                 (.01, None, None))# the move is very likely
        xsquares = {0, 9}
        corners = {1, 8}
        corner_to_xsqaure = {1: 0, 8: 9}
        if pos in xsquares:
            return 0.7
        elif self.legal_edge_move(player, edge, pos-1): #possibility of 100% if a move is legal
            return 1.0
        elif pos in corners:
            value_of_x = edge[corner_to_xsqaure[pos]]
            if value_of_x == EMPTY: #If the x Square is occupied by the opponent a corner move is very likely
                return 0.1
            elif value_of_x == player:
                return .001
            else:
                return .92
        else:
            chances = 2.0 if self.legal_edge_move(OPPONENT[player], edge, pos-1) else 1.0 #pos - 1 signifies the index of the edge wit x changes to index w/o x
            return edgeStaticProbability \
                       [self.edge_neighbors(player, edge, pos-1)] \
                       [self.edge_neighbors(OPPONENT[player], edge, pos-1)] / chances
