        prob = 1.0
        val = 0.0
        #print(possible,player)
        for pair in sorted(possible, key=lambda a: a[1], reverse = player == BLACK):
            if prob >= 0.0:
                val += prob * pair[0] * pair[1]
                prob -= prob * pair[0]
            else:
                break
        return round(val)



